      const frontendUrl = loadOauthConfig.frontendUrl;
      const redirectUrl = `${frontendUrl}?success=true&token=${token}&message=${encodeURIComponent("\u0E40\u0E02\u0E49\u0E32\u0E2A\u0E39\u0E48\u0E23\u0E30\u0E1A\u0E1A\u0E2A\u0E33\u0E40\u0E23\u0E47\u0E08 \u0E14\u0E49\u0E27\u0E22 provider \u0E01\u0E23\u0E38\u0E13\u0E32\u0E23\u0E2D\u0E2A\u0E31\u0E01\u0E04\u0E23\u0E39\u0E48...")}`;
