var validateCurrentUser2 = (currentUser) => {
  if (!currentUser || !currentUser.users_id) {
    return "\u0E44\u0E21\u0E48\u0E2A\u0E32\u0E21\u0E32\u0E23\u0E16\u0E23\u0E30\u0E1A\u0E38\u0E1C\u0E39\u0E49\u0E43\u0E0A\u0E49\u0E1B\u0E31\u0E08\u0E08\u0E38\u0E1A\u0E31\u0E19\u0E44\u0E14\u0E49";
  }
  if (typeof currentUser.users_id !== "number" || currentUser.users_id <= 0) {
    return "\u0E02\u0E49\u0E2D\u0E21\u0E39\u0E25\u0E1C\u0E39\u0E49\u0E43\u0E0A\u0E49\u0E1B\u0E31\u0E08\u0E08\u0E38\u0E1A\u0E31\u0E19\u0E44\u0E21\u0E48\u0E16\u0E39\u0E01\u0E15\u0E49\u0E2D\u0E07";
  }
  if (!currentUser.role) {
    return "\u0E44\u0E21\u0E48\u0E2A\u0E32\u0E21\u0E32\u0E23\u0E16\u0E23\u0E30\u0E1A\u0E38\u0E2A\u0E34\u0E17\u0E18\u0E34\u0E4C\u0E1C\u0E39\u0E49\u0E43\u0E0A\u0E49\u0E44\u0E14\u0E49";
  }
  return null;
};
var validateGetChecklistData = (query) => {
  const { start_date, end_date } = query;
  const dateRegex = /^\d{4}-\d{2}-\d{2}$/;
  if (start_date && !dateRegex.test(start_date)) {
    return "\u0E23\u0E39\u0E1B\u0E41\u0E1A\u0E1A start_date \u0E44\u0E21\u0E48\u0E16\u0E39\u0E01\u0E15\u0E49\u0E2D\u0E07 (\u0E15\u0E49\u0E2D\u0E07\u0E40\u0E1B\u0E47\u0E19 YYYY-MM-DD)";
  }
  if (end_date && !dateRegex.test(end_date)) {
    return "\u0E23\u0E39\u0E1B\u0E41\u0E1A\u0E1A end_date \u0E44\u0E21\u0E48\u0E16\u0E39\u0E01\u0E15\u0E49\u0E2D\u0E07 (\u0E15\u0E49\u0E2D\u0E07\u0E40\u0E1B\u0E47\u0E19 YYYY-MM-DD)";
  }
  if (start_date && end_date) {
    const startDate = new Date(start_date);
    const endDate = new Date(end_date);
    if (startDate > endDate) {
      return "start_date \u0E15\u0E49\u0E2D\u0E07\u0E44\u0E21\u0E48\u0E40\u0E01\u0E34\u0E19 end_date";
    }
  }
  return null;
};
var buildDateRangeClause = (startDate, endDate) => {
  const conditions = [];
  const values = [];
  let paramIndex = 1;
  if (startDate) {
    conditions.push(`checked_date >= $${paramIndex}`);
    values.push(startDate);
    paramIndex++;
  }
  if (endDate) {
    conditions.push(`checked_date <= $${paramIndex}`);
    values.push(endDate);
    paramIndex++;
  }
  return {
    clause: conditions.length > 0 ? conditions.join(" AND ") : "",
    values
  };
};
var buildPermissionClause = (user, dateClause, dateValues) => {
  const conditions = [];
  const values = [...dateValues];
  let paramIndex = dateValues.length + 1;
  conditions.push("vc.is_active = TRUE");
  if (dateClause) {
    conditions.push(dateClause);
  }
  if (user.role !== "admin") {
    conditions.push(`vc.checked_by = $${paramIndex}`);
    values.push(user.users_id);
  }
  return {
    clause: conditions.join(" AND "),
    values
  };
};

// src/controllers/main-check-controllers/view/view-controllers.ts
var getChecklistController = async ({
  set: set2,
  query,
  authValid,
  authMessage,
  authStatusCode,
  user
}) => {
  try {
    if (!authValid) {
      set2.status = authStatusCode || 401;
      return { success: false, message: authMessage || "\u0E44\u0E21\u0E48\u0E21\u0E35\u0E2A\u0E34\u0E17\u0E18\u0E34\u0E4C\u0E40\u0E02\u0E49\u0E32\u0E16\u0E36\u0E07" };
    }
    const userValidationError = validateCurrentUser2(user);
    if (userValidationError) {
      set2.status = 401;
      return { success: false, message: userValidationError };
    }
    const queryValidationError = validateGetChecklistData(query || {});
    if (queryValidationError) {
      set2.status = 400;
      return { success: false, message: queryValidationError };
    }
    const { start_date, end_date } = query || {};
    const dateRange = buildDateRangeClause(start_date, end_date);
    const permissionClause = buildPermissionClause(user, dateRange.clause, dateRange.values);
    const sqlQuery = `
            SELECT 
                vc.id,
                vc.vehicle_id,
                vc.vehicle_name,
                vc.checked_date,
                vc.checked_by,
                u.username,
                vc.checklist_items,
                vc.created_at,
                vc.updated_at
            FROM vehicle_checklist vc
            LEFT JOIN users u ON vc.checked_by = u.id
            WHERE ${permissionClause.clause}
            ORDER BY vc.checked_date DESC, vc.created_at DESC
        `;
    const result = await db.query(sqlQuery, permissionClause.values);
    if (result.rows.length === 0) {
      return {
        success: true,
        data: []
      };
    }
    const checklistIds = result.rows.map((row) => row.id);
    const photosQuery = `
            SELECT 
                ip.id as photo_id,
                ip.vehicle_checklist_id,
                ip.checklist_template_id,
                ip.photo_path,
                ip.description,
                ip.created_at as photo_created_at
            FROM inspection_photos ip
            WHERE ip.vehicle_checklist_id = ANY($1) 
                AND ip.is_active = TRUE
            ORDER BY ip.checklist_template_id, ip.created_at ASC
        `;
    const photosResult = await db.query(photosQuery, [checklistIds]);
    const photosMap = new Map;
    photosResult.rows.forEach((photo) => {
      const key = `${photo.vehicle_checklist_id}_${photo.checklist_template_id}`;
      if (!photosMap.has(key)) {
        photosMap.set(key, []);
      }
      photosMap.get(key).push({
        id: photo.photo_id,
        photo_path: photo.photo_path,
        description: photo.description,
        created_at: photo.photo_created_at
      });
    });
    const checklistData = result.rows.map((row) => {
      const checklistItems = row.checklist_items?.items || [];
      const updatedItems = checklistItems.map((item) => {
        const checklistTemplateId = typeof item.checklist_id === "string" ? parseInt(item.checklist_id, 10) : item.checklist_id;
        const photoKey = `${row.id}_${checklistTemplateId}`;
        const photos = photosMap.get(photoKey) || [];
        return {
          ...item,
          photos
        };
      });
      return {
        id: row.id,
        vehicle_id: row.vehicle_id,
        vehicle_name: row.vehicle_name,
        checked_date: row.checked_date.toLocaleDateString("sv-SE"),
        checked_by: row.checked_by,
        username: row.username,
        checklist_items: {
          items: updatedItems
        },
        created_at: row.created_at,
        updated_at: row.updated_at
      };
    });
    return {
      success: true,
      data: checklistData
    };
  } catch (error) {
    console.error("Error in getChecklistController:", error);
    set2.status = 500;
    return {
      success: false,
      message: "\u0E40\u0E01\u0E34\u0E14\u0E02\u0E49\u0E2D\u0E1C\u0E34\u0E14\u0E1E\u0E25\u0E32\u0E14\u0E43\u0E19\u0E01\u0E32\u0E23\u0E14\u0E36\u0E07\u0E02\u0E49\u0E2D\u0E21\u0E39\u0E25 checklist"
    };
  }
};

